import React, { Component } from 'react';
import ImageView from './ImageView';
import img1 from '../assets/rose1.jpg';
import img2 from '../assets/rose2.jpg';
import img3 from '../assets/rose3.jpg';

class Cards extends Component{
    render(){
        return (
            <div className='container-fluid d-flex justify-content-center'>
                <div className='row'>
                    <div className='col-md-4'>
                        <ImageView imgsrc={img1} title="Console"/>
                    </div>
                    <div className='col-md-4'>
                        <ImageView imgsrc={img2} title="Console"/>
                    </div>
                    <div className='col-md-4'>
                        <ImageView imgsrc={img3} title="Console"/>
                    </div>
                </div>
            </div>
        );
    }
}
export default Cards;
